/*Breadcrumbs*/
.breadcrumb {
  background: #25C7D9; 
  border: 0px solid rgba(245, 245, 245, 1); 
  border-radius: 4px; 
  display: block;
  font-size: 20px;
  font-family: 'Lato';
  font-weight: bold;
  margin-bottom: 50px;
  margin-top: 50px;
}
.breadcrumb li {
  font-size: 14px;
  display: inline-block;
}
.breadcrumb a {
  color: rgba(250, 250, 250, 1);
}
.breadcrumb a:hover {
  color: white;
}
.breadcrumb>.active {
  color: white;
}
.breadcrumb>li+li:before {
  color:white; 
  content: "\276F\00a0";
}


/*Navigation bar*/

