/*move bubble*/

@keyframes bubble-1 {
  0% {
    transform: scale(1);
    left:0px; 
    bottom:-100px;
  }
  20% {
    transform: scaleY(0.95) scaleX(1.05);
    left:0px; 
    bottom:0px;
  }
