/*call to action*/
.btn-primary:link,
.btn-primary:visited{
  text-decoration: none;
  text-transform:uppercase;
  position:relative;
  top:0;
  left:0;
  padding:20px 40px;
  border-radius:100px;
  display:inline-block;
  transition: all .5s;
}
.btn-primary{
  background:#881DF2;
  color:#fff;
  border-color: #881DF2;
}
.btn-primary:hover{
   box-shadow:0px 10px 10px rgba(0,0,0,0.2);
   transform : translateY(-3px);
   background: #4878D9;
   border-color: #4878D9;
}
.btn-primary:active{
  box-shadow:0px 5px 10px rgba(0,0,0,0.2);
  transform:translateY(-10px);
}

.btn-primary{
  animation:primerboton 1s ease-out .8s;
}

.btn-primary::after{
  content:"";
  text-decoration: none;
  text-transform:uppercase;
  position:absolute;
  width:100%;
  height:100%;
  top:0;
  left:0;
  border-radius:100px;
  display:inline-block;
  z-index:-1;
  transition: all .5s;
}

.btn-primary::after {
    background: #4878D9;
    border-color: #4878D9;
}

.btn-primary:hover::after {
    transform: scaleX(1.4) scaleY(1.6);
    opacity: 0;
    background: #4878D9;
    border-color: #4878D9;
}

@keyframes primerboton{
  0%{
    opacity:0;
    transform:translateY(40px);
  } 
  100%{
    opacity:1;
    transform:translateY(0);
  }
}
.btn-secondary {
  background-color: #25C7D9;
  border-color: #25C7D9;
}

.btn-secondary:active, .btn-secondary:focus, .btn-secondary:hover {
  background-color: #05F2C7;
  border-color: #05F2C7;
  animation: rotate 0.7s ease-in-out both;
}
.btn-secondary:active {
  background-color: #05F2C7;
  border-color: #05F2C7;
}

.btn-secondary:focus {
  box-shadow: 0 0 0 0.2rem rgba(37, 199, 217, 0.5);
}



@keyframes rotate {
    0% {
        transform: rotate(0deg)  translate3d(0, 0, 0);
      }
    25% {
        transform: rotate(3deg)  translate3d(0, 0, 0);
      }
    50% {
        transform: rotate(-3deg)  translate3d(0, 0, 0);
      }
    75% {
        transform: rotate(1deg)  translate3d(0, 0, 0);
      }
    100% {
        transform: rotate(0deg)  translate3d(0, 0, 0);
      }
    }
  


